import React, { useState } from 'react'

const Main = () => {
  const [portfolios, setPortfolios] = useState([])
  return (
    <div className="h-screen w-full bg-slate-400">
      <div>
        <input type="text" name="name" />
        <input type="text" name="github" />
        <input type="text" name="live" />
      </div>
    </div>
  )
}

export default Main
